	function topkek.libwindows:switchWindow(w, x)

		for _, k in pairs(topkek.libwindows.windows) do

			if k.Name == w then

				k.Visible = true

			else

				k.Visible = false

			end	

		end

		if w == 'HomeContainer' then

			base.Navigator.Visible = false

		else

			base.Navigator.Visible = true

		end

		base.Top.Location.Text = x

	end

