		local wins = topkek.libsettings:getSetting('windows')

		local y = 5

		for _, k in pairs(wins) do

			local o = template:Clone()

			o.Parent = nav

			o.Position = UDim2.new(0, 5, 0, y)

			o.Text = k

			o.MouseButton1Down:connect(function()

